import React from "react";


const User = ({ usuario }) => (
 
<div>

{usuario.map(usuario => (
      <User usuario={usuario} />
  ))}
    <span>{usuario.avatar_url}</span>
    <span>{usuario.login}</span>
    <span>{usuario.id}</span>
</div>


);




export default User;
